import React, { useState } from 'react';

const StateCreator = (props) => {

    let [style, setStyle] = useState({
        position: 'absolute',
        height: '100vh',
        border: '1px solid black',
        top: '0px',
        right: '0px',
        width: '20vw',
        backgroundColor: 'white',
        display: props.visibility
    });






    const closeCreator = () => {
        setStyle({
            ...style,
            display: 'none'
        })
    }

    return (
        <div style={style}>
            <button onClick={closeCreator}>X</button>


        </div>
    );
};

export default StateCreator;
